import logo from './assets/logo.svg';
import './App.css';
import BottomBar from './components/bottom-bar.js';
import { AboutMeFolderGroup } from './components/AboutMeFolderIcon.js';
import { MyComputerGroup } from './components/MyComputerGroup.js';
import iloveket from './assets/iloveket.png'


function App() {
  return (
    <div className="App">
      <MyComputerGroup></MyComputerGroup>

      <AboutMeFolderGroup ></AboutMeFolderGroup>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>My Portfolio Page</h1>
        <img src={iloveket} alt='i love cats'></img>

      </header>
      <BottomBar>  
      </BottomBar>
    </div>

  );
}



export default App;
